const DefaultCoverB64 = () => {
  const defaultCover1 =
    "data:image/png;base64,";
  const defaultCover2 =
    "data:image/png;base64,";
  const defaultCover3 =
    "data:image/png;base64,";

  const flag = Math.floor(Math.random() * 3) + 1;
  if (flag === 1) return defaultCover1;
  else if (flag === 2) return defaultCover2;
  else if (flag === 3) return defaultCover3;
  else return defaultCover1;
};

export default DefaultCoverB64;
